// Copyright 2023 StatblockWizard
window.addEventListener('load', main, false);

function main() {
    addModules();
    addSamples();
}

function addModules() {
    let e = document.getElementById('StatblockWizardModules');
    if (e) {
        addModuleViewer(e);
        addModuleCreator(e);
        addLicenseLink(e);
        addClearLastSaved(e);
    }
}

function addModuleCreator(e) {
    addMainPageLink(e, 'Create or edit a statblock', 'c', 'Creator.html', 'Open the Creator to work on a Statblock.', 'creator');
}

function addModuleViewer(e) {
    addMainPageLink(e, 'View an existing statblock', 'v', 'Viewer.html', 'Open the Viewer to see an existing statblock.', 'viewer');
}

function addLicenseLink(e) {
    addMainPageLink(e, 'Legal information', 'l', 'Legal.html', 'Shows legal information.');
}

function addMainPageLink(e, text, accessKey, link, alt, className) {
    let newMainPageLink = INPUTbutton(text,accessKey, alt,className);
    addClassnames(newMainPageLink,'mainpagelink');
    e.appendChild(newMainPageLink);
    newMainPageLink.addEventListener('click', () => {
        window.location.replace(link);
    });
}

function addClearLastSaved(e) {
    let t = 'Clear saved statblock';
    let tx = "Remove all data that was stored by this app from your browser's storage. This will enable the Demo Statblock in the Viewer.";
    let newMainPageLink = INPUTbutton(t,'', tx,'mainpagelink');
    e.appendChild(newMainPageLink);
    newMainPageLink.addEventListener('click', () => {
        DBclearStatblockWizard();
        alert('Cleared! If you close StatblockWizard now, no stored data from this App will remain.');
    });
}

function addSamples() {
    let d = document.getElementById('StatblockWizardSamples');
    addClassnames(d, 'center');

    let classnames = 'samplefigure';
    // let imgclassnames = 'sampleimage';
    let captionclassnames = 'samplecaption';
    let f1 = FIGURE('res/Archmage.statblockwizard.svg', 'Archmage', 'StatblockWizard sample statblock of an Archmage', classnames, 'sampleimage', captionclassnames);
    f1.addEventListener('click', () => {
        DBsetStatblockWizard(sampleArchmage());
        window.location.replace('Viewer.html');
    });
    let f2 = FIGURE('res/Cat.statblockwizard.svg', 'Cat', 'StatblockWizard sample statblock of a Cat, featuring Zipper.', classnames, 'sampleimage', captionclassnames);
    f2.addEventListener('click', () => {
        DBsetStatblockWizard(sampleCat());
        window.location.replace('Viewer.html');
    });
    let f3 = FIGURE('res/Cult Fanatic.statblockwizard.svg', 'Cult Fanatic', 'StatblockWizard sample statblock of a Cult Fanatic', classnames, 'sampleimage', captionclassnames);
    f3.addEventListener('click', () => {
        DBsetStatblockWizard(sampleCultFanatic());
        window.location.replace('Viewer.html');
    });
    let f4 = FIGURE('res/Obsidian Tusker.statblockwizard.svg', 'Obsidian Tusker', 'StatblockWizard sample statblock of an Obsidian Tusker', classnames, 'sampleimage', captionclassnames);
    f4.addEventListener('click', () => {
        DBsetStatblockWizard(sampleObsidianTusker());
        window.location.replace('Viewer.html');
    });
    d.appendChild(f1);
    d.appendChild(f2);
    d.appendChild(f3);
    d.appendChild(f4);
}

